import { Morph, TilingLayout } from "lively.morphic";
import { arr } from "lively.lang";
import { getAllPartResources, loadObjectFromPartsbinFolder } from "lively.morphic/partsbin.js";


export class Partsbin extends Morph {

  get isPartsBin() { return true }

  reset() {
    this.layout = new TilingLayout()
  }

  beforePublish() {
    this.clear()
  }

  __after_deserialize__(snapshot, rev) {
    super.__after_deserialize__(snapshot, rev);
    this.showObjects();
  }

  clear() {
    arr.invoke(this.submorphs.filter(ea => ea.name !== "button-bar"), "remove");
  }

  async showObjects() {
    // await this.showObjects()

    this.clear();

    var partResorces = await getAllPartResources(),
        previewProto = await loadObjectFromPartsbinFolder("part-item-for-partsbin");

    for (let partResource of partResorces) {
      var partName = partResource.name().replace(/\.json$/, "");
      var preview = this.addMorph(previewProto.copy());
      preview.showPart(partResource)
    }

  }

}

